INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (6, 17, "チカ（クリスマス）", 108401, 0, "福原綾香", "O", "カルミナ", "ヒューマン", 46, "各種楽器", 3, 4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "人々を守るために歌う、唱喚士の少女", 163);
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (6, 12, "クルミ（クリスマス）", 108501, 0, "植田佳奈", "B", "サレンディア救護院", "ヒューマン", 40, "観劇、おままごと", 9, 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "泣き虫で臆病な守ってあげたい女の子", 150);
