INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (8, 16, "ヒヨリ（ニューイヤー）", 108701, 0, "東山奈央", "A", "トゥインクルウィッシュ", "獣人族", 44, "人助け、応援", 27, 2, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "人助けが大好き！　前向き格闘娘", 155);
